import React from 'react';

const AIInsights = () => {
  return (
    <div className="ai-insights">
      <h2>AI Insights</h2>
      <p>Type a question to get AI-powered recommendations.</p>
      <input type="text" placeholder="Ask AI..." />
      <button>Submit</button>
    </div>
  );
};

export default AIInsights;
